import Menu from "./components/Menu";
import CardContent from "@mui/material/CardContent";
import CardHeader from "@mui/material/CardHeader"
function App() {
  return (
    <div>
      <CardHeader>
      <React.Fragment>
  <GlobalStyles styles={{ h1: { color: 'grey' } }} />
  <h1>Grey h1 element</h1>
</React.Fragment>
      </CardHeader>
      <CardContent>
        <Menu altura={5} />
      </CardContent>
    </div>
  );
}

export default App;
